function generateRandomKey(prefix) {
  if (prefix == null) {
    prefix = 'chart';
  }

  var userAgent = window.navigator.userAgent.replace(/[^a-zA-Z0-9]/g, '').split('');
  var mid = '';

  for (var i = 0; i < 12; i++) {
    mid += userAgent[Math.round(Math.random() * (userAgent.length - 1))];
  }

  var time = new Date().getTime();
  return prefix + '_' + mid + '_' + time;
}

function isdatetime(s) {
  if (s == null || s.toString().length < 5) {
    return false;
  } else if (checkDateTime(s)) {
    return true;
  } else {
    return false;
  }

  function checkDateTime(str) {
    var reg1 = /^(\d{4})-(\d{1,2})-(\d{1,2})(\s(\d{1,2}):(\d{1,2})(:(\d{1,2}))?)?$/;
    var reg2 = /^(\d{4})\/(\d{1,2})\/(\d{1,2})(\s(\d{1,2}):(\d{1,2})(:(\d{1,2}))?)?$/;

    if (!reg1.test(str) && !reg2.test(str)) {
      return false;
    }

    var year = RegExp.$1,
        month = RegExp.$2,
        day = RegExp.$3;

    if (year < 1900) {
      return false;
    }

    if (month > 12) {
      return false;
    }

    if (day > 31) {
      return false;
    }

    if (month == 2) {
      if (new Date(year, 1, 29).getDate() == 29 && day > 29) {
        return false;
      } else if (new Date(year, 1, 29).getDate() != 29 && day > 28) {
        return false;
      }
    }

    return true;
  }
}

function isRealNum(val) {
  if (val === "" || val == null) {
    return false;
  }

  if (!isNaN(val)) {
    return true;
  } else {
    return false;
  }
}

function hasChinaword(s) {
  var patrn = /[\u4E00-\u9FA5]|[\uFE30-\uFFA0]/gi;

  if (!patrn.exec(s)) {
    return false;
  } else {
    return true;
  }
}

function isdatatype(s) {
  var type = "string";

  if (isdatetime(s)) {
    type = "date";
  } else if (!isNaN(parseFloat(s)) && !hasChinaword(s)) {
    type = "num";
  }

  return type;
}

